---
regex: org\.mate\.panel\.applet
service: org.mate.panel.applet
templates:
  Invalid key:
  - 'Qt Warning - invalid keysym: tab'
  Send message:
  - sendMessage
  Critical:
  - CRITICAL
  Error:
  - ERROR
  Warning:
  - WARNING
  Ignore:
  - "\\[TimeStamp\\]-----main-----begin"
  - DEBUG
  - 'Gtk-Message: GtkDialog mapped without a transient parent. This is discouraged.'
